import React from "react";
import "../../src/index.css";

const person = { name: "Marla", age: 30, position: "programador" };

const Card = () => {
  return (
    <div class="person">
      <h2>Name: {person.name}</h2>
      <h3>Position: {person.position}</h3>
      <p>Age: {person.age}</p>
    </div>
  );
};

export default Card;
